import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>
                <img
                  src={require("../IMG-5355.jpg")}
                  alt=""
                  class="img-thumbnail w-25"
                />
              </th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th></th>
            </tr>
            <p>Service Booking</p>
          </tbody>
        </table>
      </div>
    );
  }
}

export default Header;
